/* @flow */
import * as React from 'react'



type Props = {
  type: string,
  theme: string,
  size: string,
  onClick: Function,
  children: React.Node,
  className: string,
  disabled: boolean,
}

const Button = (props: Props): React.Element<*> => {

  return (
    <button type={type} >
      {type == 'search' &&
      <svg viewBox="0 0 24 24" class="sprite-vue sprite-vue--app sprite-vue--search"><use href="#app/search"></use></svg>}

    </button>
  )
}

Button.defaultProps = {
  type: ButtonType.BUTTON,
  theme: ButtonTheme.DEFAULT,
  size: ButtonSize.MEDIUM,
  onClick: () => {},
  className: '',
  disabled: false,
}

export default Button
